        request.payload = { parameter : JSON.stringify({
        name : $model.name,
        CurrentObject : $model.CurrentObject,
        ClickedActionId: $model.ClickedActionId,
        ClickedActionParameter: $model.ClickedActionParameter,
        SelectedItems: $model.SelectedItems,
        SelectedObjects: $model.SelectedObjects,
        RootWindowModel: $model.RootWindowModel
    }) },
        request.headers = { authCookie : $global.authToken, 'Accept': 'application/json', 'Content-Type': 'application/json' }
    }
});
